import Link from 'next/link'

function Footer() {
  return (
    <footer style={navStyle}>

      <Link href='/'>
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href='/about'>
        <a style={linkStyle}>About</a>
      </Link>

    </footer>
  )
}

const linkStyle = {
    textDecoration: 'none',
    weight: 'bold',
    color: '#ffffff',
    marginRight: '15px',
  }
  
  const navStyle = {
    background: '#05052b',
    textAlign: 'right',
    padding: '10px',
    color: '#ffffff'
  }

export default Footer;
